function App() {
  const [isMobile, setIstMobile] = useState();

  const { height, width } = useWindowDimensions();

  return (
    <div className="App">
      <div>{width}</div>
      <Nav></Nav>
      <Hamburger></Hamburger>
    </div>
  );
}

export default App;
